import walmartLogo from '../assets/images/Walmart.png';
import logoBig from '../assets/images/logoBig.png';
import Name from '../assets/images/Name.png';
import Logo from '../assets/images/VisionXR_Logo.png';
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div className="w-full h-full bg-royalblue flex">
            {/* left side */}
            <div className='bg-gradient-to-b from-lightblue to-deepblue w-[46%]'>
                <div className='m-10'>
                        <Link to="">
                            <img src={walmartLogo} alt='logo' />
                        </Link>
                </div>
                <div className='ml-40 mt-64 w-1/2 flex justify-center items-center'>
                      <img src={logoBig} alt='logo' />
                </div>
            </div>
            {/* right side */}
            <div className=' w-[54%]'>
                <div className='m-10 flex flex-row-reverse'>
                        <Link to="">
                            <img src={Name} alt='logo' />
                        </Link>
                </div>
            </div>
        </div>
    )
};

export default Home;
